import React, { useEffect, useState } from "react";
import config from "config";
import axios from "axiosConfig";
import { Card, Input, Button, Form, Divider, Tooltip, Row, Col, Select, InputNumber} from 'antd';
import { QuestionCircleOutlined } from "@ant-design/icons";
import { Tabs } from 'antd';
import ConfirmationModal from "components/Modal/ConfirmationModal";
import ENUMS from "constants/appEnums";
import HttpUtil from "util/HttpUtil";
import { useHistory, useLocation } from "react-router";
import { useToasts } from "react-toast-notifications";
import FormInitialValues from "constants/formInitialValues";

const { Option } = Select;
const { TabPane } = Tabs;

export default function DefaultValues() {
    let location = useLocation();
    const { addToast } = useToasts();
    const history = useHistory();

    const [modalData, setModalData] = useState(null);
    const [showConfirmationModal, setShowConfirmationModal] = useState(false);

    const [defaultValues, setDefaultValues] = useState([]);
    const [projectId, setProjectId] = useState();
    const [wellId, setWellId] = useState();

    const handleCancel = () => {
        setShowConfirmationModal(false);
        setModalData(null);
    }

    const handleChangeConfirmed = (data) => {

        setShowConfirmationModal(false);
        setModalData(null);
    }

    const onFinish = (values) => {
        const newvalue = {
            ...FormInitialValues.defaultValueForm,
            ...values
        }
        setModalData(newvalue);
        setShowConfirmationModal(true);
    };

    const callback = (key) => {
        console.log(key);
    }

    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };

    const fetchDefaultValues = (well_id) => {
        axios.get(config.API_URL + ENUMS.API_ROUTES.DEFAULT_VALUE + '/' + well_id,
            {
                ...HttpUtil.adminHttpHeaders(),
            })
            .then(res => {
                if (res.status === 200 && res.data) {
                    console.log(res.data)
                }
            })
            .catch(e => {
                console.log(e)
            })
    }

    const setParams = (locationData) => {
        if (locationData.state && locationData.state.projectId) {
            setProjectId(locationData.state.projectId);
            setWellId(locationData.state.wellId);
            fetchDefaultValues(locationData.state.wellId);
        }
        else if (locationData.search) {
            const params = new URLSearchParams(locationData.search);
            const projectIdSearch = params.get('projectId');
            const wellIdSearch = params.get('wellId');
            setProjectId(projectIdSearch);
            setWellId(wellIdSearch);
            fetchDefaultValues(wellIdSearch);
        }
    }

    useEffect(() => {
        setParams(location);
    }, [])

    useEffect(() => {
        return history.listen((locationData) => { 
            if(location.pathname === (ENUMS.ROUTES.ADMIN + ENUMS.ROUTES.DEFAULT_VALUES)) {
                setParams(locationData);
            }
        }) 
    }, [history])

    return (
        <>
            <Card bordered={false} style={{ width: '100%', marginBottom: '5px' }}>
                <div className="max-w-580-px mx-auto">
                    <div>
                        On the template page fill any information that may be relevant across all stages,
                        such information is found in completion procedures etc. Common information that can be
                        normally filled out in the template is the following:
                    </div>
                </div>
            </Card>
            <Card bordered={false} style={{ width: '100%', marginBottom: '1.5rem' }}>
                <Form
                    labelAlign="left"
                    name="basic"
                    initialValues={FormInitialValues.defaultValueForm}
                    onFinish={onFinish}
                    onFinishFailed={onFinishFailed}
                    className="default-values-form"
                >
                    <Tabs onChange={callback} type="card">
                        <TabPane tab="Parameter bounds" key="1">
                            <Divider orientation="left" plain><strong>Parameter bounds</strong></Divider>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C1 Min
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c1_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C1 Max
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c1_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C2 Min
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c2_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C2 Max
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c2_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C3 Min
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c3_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                C3 Max
                                                <Tooltip title="Velocity m/s">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="c3_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Q1 Min
                                                <Tooltip title="Wellbore Quality/Energy, no unit">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="q_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>    
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Q1 Max
                                                <Tooltip title="Wellbore Quality/Energy, no unit">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="q_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                K min
                                                <Tooltip title="Permeability, Darcy mD">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="k_min"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                K max
                                                <Tooltip title="Permeability, Darcy mD">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="k_max"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Model Params" key="2">
                            <Divider orientation="left" plain><strong>Model Params</strong></Divider>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Model
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="model"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Select>
                                            <Option value="assymetric">Assymetric</Option>
                                        </Select>
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Response
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="response"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Select>
                                            <Option value="full">Full</Option>
                                        </Select>
                                    </Form.Item>
                                </Col>
                            </Row>
                            <Row gutter={24}>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Source
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="source"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Select>
                                            <Option value="reflection">Reflection</Option>
                                        </Select>
                                    </Form.Item>
                                </Col>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Layer
                                                <Tooltip title="-">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="layer"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <InputNumber className="w-100"/>
                                    </Form.Item>
                                </Col>
                            </Row>

                            <Form.Item className="text-right">
                                <Button type="primary" htmlType="submit">
                                    Save
                                </Button>
                            </Form.Item>
                        </TabPane>
                        <TabPane tab="Fluid properties" key="3">
                            <Divider orientation="left" plain><strong>Fluid properties</strong></Divider>
                            <Row>
                                <Col span={10}>
                                    <Form.Item
                                        label={
                                            <span>
                                                Viscosity
                                                <Tooltip title="">
                                                    <QuestionCircleOutlined className="icon-form-info"/>
                                                </Tooltip>
                                            </span>
                                        }
                                        name="viscosity"
                                        style={{marginLeft: '5rem' }}
                                    >
                                        <Input />
